import React, { Component } from 'react';
import NextButton from './NextButton'

class StudyFlashcards extends Component {

    render() {
        return (
            <div style={outerContainerStyle}>
                <div style={flashcardContainerStyle}>
                    <h1 style={{fontWeight: 'normal'}}>Economics</h1>
                </div>
                <div style={buttonsContainerStyle}>
                    <NextButton nextClick={this.nextClick}/>
                </div>
            </div>
        );
    }
}

const outerContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
    padding: '40px',
};
const flashcardContainerStyle = {
    width: '600px',
    height: '300px',
    background: '#fff',
    boxShadow: '1px 1px 5px #7a7a7a',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
};
const buttonsContainerStyle = {
    marginLeft: '30px',
    height: '300px',
    display: 'flex',
    alignItems: 'center',
};

export default StudyFlashcards;
